import styled from 'styled-components'
const Button = () => {
  const Button = styled.button`
    position: absolute;
    top: 10px;
    right: 150px;
    color: white;
    background-color: rgb(107, 105, 105);
    border-radius: 10px;
    border: none;
    width: 70px;
    height: 30px;
    cursor: pointer;
    box-shadow: 1px 2px;
  `

  return (
    <>
      <Button>Publish</Button>
    </>
  )
}

export default Button
